Help Anna follow an ancient map and conquer the obstacles in her way to find the lost treasures of ancient Atlantis! As a young and ambitious archaeologist, Anna discovers a fragment of a mysterious map leading to the underwater kingdom. Dive into Atlantis: Mysteries of Ancient Inventions, and scour awesome Hidden Object scenes to discover secrets that have been protected for centuries.

